import Card from '@mui/material/Card';
import './musicplay.css'
import FavoriteIcon from '@mui/icons-material/Favorite';
import { CardMedia } from '@mui/material';


const MusicPlay = () => {

  return (
    <>
      <div className="card_box">
        <Card sx={{display:"flex"}}>
        <FavoriteIcon/>
        <CardMedia
        sx={{ height: 300 }}
        image="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT8GeKxsWps0j_c2g-JZs8A604cre5vRZUD1A19urAFhwszgmFpF_RG55rcNgTN5onHOio&usqp=CAU"
        title="green iguana"
      />

        </Card>
      </div>
    </>
  )
}
export default MusicPlay;
